   "source": [
    "# # # # Principal Component Analysis(PCA)\n",
    "In our customer data, we have three important pieces of information for each customer: their age, their annual income, and their spending score. Each of these tells us something different about the customer. By doing PCA, we’re making our data easier to understand and visualize. Instead of trying to look at three pieces of information at once, we can just look at two. This allows us to see patterns and groups (clusters) in our data more clearly. The way we do it is by combining our original pieces of information (age, annual income, and spending score) into two new ones (Principal Components) that summarize the most important information from our original data. \n",
    "Let's proceed to now do a PCA - "
   ]
